import React from 'react';
import './Specialty-Skill.css';


class AboutMe extends React.Component {
	constructor(props) {
    super(props);
  }
  render(){
  	const s_s_list=[
  		{
  			"name":"Networked Control",
  			"level":"88%",

  		},
  		{
  			"name":"Machine Learning",
  			"level":"80%",
  		},
  		{
  			"name":"Network Science",
  			"level":"86%",
  		},
  		{
  			"name":"Embedded System",
  			"level":"80%",
  		},
  		{
  			"name":"Hybrid System",
  			"level":"88%",
  		},
  		{
  			"name":"Stochastic System",
  			"level":"72%",
  		},
  		{
  			"name":"Epidemiology",
  			"level":"75%",
  		},
  		{
  			"name":"Python, Flask",
  			"level":"88%",
  		},
  		{
  			"name":"C, C++",
  			"level":"84%",
  		},
  		{
  			"name":"React, Node.js", 
  			"level":"88%",
  		},
  		{
  			"name":"AWS",
  			"level":"68%",
  		},
  		{
  			"name":"Docker",
  			"level":"80%",
  		},
  		{
  			"name":"Communication",
  			"level":"90%",
  		},
  	];

  	return(
  		<div class="s-s-container">
  			<div class="main-title">
  			Specialty & Skill
  			</div>
  			<div class="s-s-main">
			{s_s_list.map((s_s_item)=>{
				return(
					<div class="s-s-wrap">
  						<div class="s-s-title">
  							{s_s_item.name}
  						</div>
  						<div class="s-s-level-wrap">
  							<div class="s-s-level" style={s_s_item.width}></div>
  						</div>
  					</div>
				);
			})}
  				<div class="s-s-wrap">
  					<div class="s-s-title">
  						React
  					</div>
  					<div class="s-s-level-wrap">
  						<div class="s-s-level"></div>
  					</div>
  				</div>

  				<div class="s-s-wrap s-s-wrap-r">
  					<div class="s-s-title">
  						React
  					</div>
  					<div class="s-s-level-wrap">
  						<div class="s-s-level"></div>
  					</div>
  				</div>

  				<div class="s-s-wrap">
  					<div class="s-s-title">
  						React
  					</div>
  					<div class="s-s-level-wrap">
  						<div class="s-s-level"></div>
  					</div>
  				</div>
  			</div>
  		</div>
  	);
  }
}


export default AboutMe;
